import { Droppable } from "react-beautiful-dnd";
import "../assets/scss/_kanban.scss";

const KanbanColumn = () => {
  return (
    <div className="kanban-column-container">
          <h3 className="kanban-title">Title</h3>
          
          <Droppable></Droppable>
    </div>
  );
};

export default KanbanColumn;
